window.hideScrollOverflowByTag=n=>{var i,t;if(n.toLowerCase()==="body")document.body.classList.add("blazor-javascript-no-overflow");else{i=document.getElementsByTagName(n);for(t in i)Object.prototype.hasOwnProperty.call(i,t)&&t.classList!==undefined&&t.classList.add("blazor-javascript-no-overflow")}};window.hideScrollOverflowByClass=n=>{var i,t;if(n===undefined)document.body.classList.add("blazor-javascript-no-overflow");else{i=document.getElementsByClassName(n);for(t in i)Object.prototype.hasOwnProperty.call(i,t)&&t.classList!==undefined&&t.classList.add("blazor-javascript-no-overflow")}};window.showScrollOverflowByTag=n=>{var i,t;if(n.toLowerCase()==="body")document.body.classList.remove("blazor-javascript-no-overflow");else{i=document.getElementsByTagName(n);for(t in i)Object.prototype.hasOwnProperty.call(i,t)&&t.classList!==undefined&&t.classList.remove("blazor-javascript-no-overflow")}};window.showScrollOverflowByClass=n=>{var i,t;if(n===undefined)document.body.classList.remove("blazor-javascript-no-overflow");else{i=document.getElementsByClassName(n);for(t in i)Object.prototype.hasOwnProperty.call(i,t)&&t.classList!==undefined&&t.classList.remove("blazor-javascript-no-overflow")}};